import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';
import Navbar from './Navbar';

function App() {
  return (
    <Router>
      <div className='App'>
          <Navbar></Navbar>
          <div className="content">
            <Switch>
              <Router>
                <Home></Home>
              </Router>
            </Switch>
          </div>

      </div>
    </Router>
  );
}

export default App;
